import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, Grid, Typography, Container, Breadcrumbs, Link } from '@material-ui/core';
import styles from './style';

import Header from '../../components/header';
import Footer from '../../components/footer';

class Cambio extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { classes, t } = this.props;

    return (
      <>
        <Header />
        <div className={classes.bar}></div>

        <Grid container className={classes.banner1}>
          <Container>
            <Grid className={classes.banner}></Grid>
          </Container>
        </Grid>
        <Footer />
      </>
    );
  }
}

export default withRouter(withStyles(styles)(Cambio));
